import React from 'react';
import { Navigate } from 'react-router-dom';

function PrivateRoute({ children }) {
    const token = localStorage.getItem('user-token');

    if (token === null) {
        return <Navigate to='/testsite' />;
    }
    
    return children;
}

export default PrivateRoute;
